r a bigger stage than the Moon Theater. The Crystal Tower Theater in the glamorous big city would be perfect - but there's one small problem. Actually, three. First, Buster Moon, mother pig Rosita, rocker porcupine Ash, elephant Meena, gorilla Johnny and pop provocateur, pig Gunter, must somehow make it to the office of music mogul Jimmy Crystal and convince the unscrupulous wolf to let them use his theater. It's a hopeless endeavor until Gunter spontaneously promises him the scoop: rock legend Clay Calloway (Bono) will return to the stage for this show! The problem: Buster has never met Clay, a lion who has retired from show business! While Moon's all-star ensemble works to put on the spectacular show, the koala sets out to find Clay. What begins as a dream of great success becomes an emotional reminder of the healing power of music.\n\n© Universal Pictures\n\nBuster Moon, and his all-star cast of performers prepare to launch their most dazzling stage extravaganza yet …all in the glittering entertainment capital of the world. There’s just one hitch: They first have to persuade the world’s most reclusive rock star—played by global music icon Bono, in his animated film debut—to join them.\n \nBuster (Oscar® winner Matthew McConaughey) has turned the New Moon Theater into a local hitbut Buster has his eyes on a bigger prize: Debuting a new show at the Crystal Tower Theater in glamorous Redshore City.\n \nBut with no connections, Buster and his cast—including harried mother pig Rosita (Oscar® winner Reese Witherspoon), rocker porcupine Ash (Scarlett Johansson), earnest gorilla Johnny (Taron Egerton), shy elephant Meena (Tori Kelly) and, of course, porcine provocateur Gunter (Nick Kroll)—have to sneak their way into the world-famous Crystal Entertainment offices, run by ruthless mogul wolf Jimmy Crystal (Emmy winner Bobby Cannavale).\n \nIn a desperate attempt to get Mr. Crystal’s attention, Gunter spontaneously pitches an outrageous idea that Buster quickly runs with, promising that their new show will star lion rock legend Clay Calloway (Bono). Problem is, Buster has never met Clay, an artist who shut himself away from the world more than a decade ago after the loss of his wife. Even worse, Buster has failed to realize that Mr. Crystal is an egocentric gangster who would rather drop somebody off the roof of a building than be lied to.\n \nAs Gunter helps Buster dream up an out-of-this-world theatrical masterpiece, and the pressure (and sinister threats) from Mr. Crystal mount, Rosita’s leading role in the show gets ripped away and handed to Mr. Crystal’s spoiled daughter, Porsha, played by Grammy-nominated artist Halsey. Desperate to save the show, and his life, Buster embarks on a quest to find Clay and persuade him to return to the stage.\n \nWhat begins as a dream of big-time success becomes an emotional reminder of the power of music to heal even the most broken heart.\n \nSing 2 is written and directed by acclaimed returning filmmaker Garth Jennings.\n \n#Halsey #SING2 #Porsha #CouldHaveBeenMe",
